import React from 'react';

const quoteBlock = {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    padding: '3vw'
}

const quoteCont = {
    border: '1px solid rgb(166, 25, 46)',
    maxWidth: '75%',
}

const leftQuoteImg = {
    height: '6vw',
    position: 'relative',
    top: 0,
    left: 0,
}

const quoteText = {
    fontFamily: 'Ariel, serif',
    fontSize: '3vw',
    margin: '1.8vw 10vw',
}

const rightQuoteImg = {
    height: '6vw',
}

function QuoteBlock(props) {
    return (
        <div style={ quoteBlock } className="quoteBlock">
            <div style={ quoteCont }>
                <img src="./images/leftQuote.png" style={ leftQuoteImg } />
                <div style={ quoteText}>
                    { props.quote || 'quote Required' }
                </div>
                <div style={rightQuoteImg}></div>
                <img src="./images/rightQuote.png" style={ rightQuoteImg } />
            </div>
        </div>
    );
}

export default QuoteBlock;
